    "# Part : Spatial Analysis\n",
    "\n",
    "#  Total Entries by Site\n",
    "plt.figure(figsize=(15, 6))\n",
    "site_total = flux_quotidien_clean.groupby('Site')['Entrées'].sum().sort_values(ascending=False)\n",
    "sns.barplot(x=site_total.index, y=site_total.values)\n",
    "plt.title('Total des Entrées par Site')\n",
    "plt.xlabel('Site')\n",
    "plt.ylabel('Total des Entrées')\n",
    "plt.xticks(rotation=45)\n",
    "plt.tight_layout()\n",
    "plt.show()\n",
    "\n",
    "#  Average Daily Entries by Site\n",
    "plt.figure(figsize=(15, 6))\n",
    "site_daily_avg = flux_quotidien_clean.groupby(['Site', 'Jour'])['Entrées'].sum().groupby('Site').mean().sort_values(ascending=False)\n",
    "sns.barplot(x=site_daily_avg.index, y=site_daily_avg.values)\n",
    "plt.title('Moyenne Journalière des Entrées par Site')\n",
    "plt.xlabel('Site')\n",
    "plt.ylabel('Moyenne des Entrées par Jour')\n",
    "plt.xticks(rotation=45)\n",
    "plt.tight_layout()\n",
    "plt.show()\n",
    "\n",
    "#  Monthly Entries by Site\n",
    "site_monthly_avg = (\n",
    "    flux_quotidien_clean.groupby(['Site', 'mois'])['Entrées']\n",
    "    .mean()\n",
    "    .reset_index()\n",
    ")\n",
    "\n",
    "# Pivot\n",
    "pivot_data = site_monthly_avg.pivot(index='Site', columns='mois', values='Entrées')\n",
    "\n",
    "# Création du graphique\n",
    "plt.figure(figsize=(15, 6))\n",
    "for site in pivot_data.index:\n",
    "    plt.plot(pivot_data.columns, pivot_data.loc[site], marker='o', label=site)\n",
    "\n",
    "# labels\n",
    "plt.title(\"Évolution Mensuelle des Entrées par Magasin\", fontsize=16)\n",
    "plt.xlabel(\"Mois\", fontsize=12)\n",
    "plt.ylabel(\"Moyenne des Entrées\", fontsize=12)\n",
    "plt.xticks(ticks=range(1, 13), labels=[f'Mois {i}' for i in range(1, 13)], rotation=45)\n",
    "plt.legend(title=\"Magasins\", bbox_to_anchor=(1.05, 1), loc='upper left')\n",
    "plt.grid(axis='y', linestyle='--', alpha=0.7)\n",
    "plt.tight_layout()\n",
    "plt.show()\n",
    "\n",
    "# Box Plot by Site and Zone\n",
    "plt.figure(figsize=(15, 6))\n",
    "sns.boxplot(data=flux_quotidien_clean, x='Site', y='Entrées', hue='Zone')\n",
    "plt.title('Distribution des Entrées par Site et Zone')\n",
    "plt.xlabel('Site')\n",
    "plt.ylabel('Entrées')\n",
    "plt.xticks(rotation=45)\n",
    "plt.legend(bbox_to_anchor=(1.05, 1), loc='upper left')\n",
    "plt.tight_layout()\n",
    "plt.show()\n",
    "\n",
    "# Print summary statistics\n",
    "print(\"\\n=== Statistiques par Site ===\")\n",
    "site_stats = flux_quotidien_clean.groupby('Site')['Entrées'].agg(['mean', 'median', 'std', 'min', 'max'])\n",
    "print(site_stats.round(2))"
