    "print(commerce_cc.describe(include='all'))\n",
    "\n",
    "# 3. Verification of unique values per column\n",
    "print(\"\\n=== Valeurs uniques par colonne ===\")\n",
    "for col in commerce_cc.columns:\n",
    "    unique_values = commerce_cc[col].nunique()\n",
    "    print(f\"{col} : {unique_values} valeurs uniques\")\n",
    "\n",
    "# 4. Visualisation of numerical columns\n",
    "import matplotlib.pyplot as plt\n",
    "import seaborn as sns\n",
    "\n",
    "# Distribution of numerical columns\n",
    "numeric_cols = commerce_cc.select_dtypes(include='number').columns\n",
    "\n",
    "for col in numeric_cols:\n",
    "    plt.figure(figsize=(8, 4))\n",
    "    sns.boxplot(data=commerce_cc, x=col)\n",
    "    plt.title(f\"Distribution de {col}\")\n",
    "    plt.show()\n",
    "\n",
    "# 5. Verification of duplicates\n",
    "duplicates = commerce_cc.duplicated().sum()\n",
