    "import pandas as pd\n",
    "import matplotlib.pyplot as plt\n",
    "\n",
    "# Supposons que 'average_time' est votre dataframe déjà chargé\n",
    "\n",
    "# Transformation du dataframe pour un format long\n",
    "average_time_long = average_time.melt(\n",
    "    id_vars=['Nom centre', 'Zone', 'ID Mall'],\n",
    "    var_name='Mois',\n",
    "    value_name='Valeur'\n",
    ")\n",
    "\n",
    "# Création d'un line chart\n",
    "plt.figure(figsize=(14, 8))\n",
    "for centre in average_time['Nom centre'].unique():\n",
    "    data = average_time_long[average_time_long['Nom centre'] == centre]\n",
    "    plt.plot(data['Mois'], data['Valeur'], label=centre)\n",
    "\n",
    "# Personnalisation du graphique\n",
    "plt.title('Évolution des Valeurs Moyennes par Mois pour chaque Centre Commercial', fontsize=16)\n",
    "plt.xlabel('Mois', fontsize=12)\n",
    "plt.ylabel('Valeur Moyenne', fontsize=12)\n",
    "plt.xticks(rotation=45)\n",
    "plt.legend(title='Nom Centre', bbox_to_anchor=(1.05, 1), loc='upper left')\n",
    "plt.tight_layout()\n",
    "plt.grid(visible=True, linestyle='--', alpha=0.7)\n",
    "plt.show()"
